import React from 'react';
import Header from '../components/Header';
import Footer from '../components/Footer';
import './Jobs.css';

function Jobs() {
  return (
    <div className="jobs">
      <Header />
      <main>
        <h1>Jobs</h1>
        <p>Explore career opportunities at StreamFlix.</p>
      </main>
      <Footer />
    </div>
  );
}

export default Jobs;
